6	История появления эмодзи	istoriya-poyavleniya-emod	<p>Еще лет 5-10 назад люди слабо представляли или вообще не знали, что такое эмодзи и как их использовать. А сейчас эти значки стали чуть ли не еще одним способом общения, отдельным языком, состоящим из картинок. Люди в социальных сетях активно вставляют эмодзи в свои сообщения, а компании используют эмодзи в рекламе.&nbsp;Но даже сейчас немногие знают, как и когда появились эмодзи.</p>\r\n\r\n<p>Необычное слово &laquo;эмодзи&raquo; (или на английском &ldquo;emoji&rdquo;) пришло в нашу речь из японского языка: 絵文字, где 絵 &mdash; картинка и 文字 &mdash; знак, символ. Несложно догадаться, что они были придуманы именно в Японии. Произошло это в 1999 году: Сигэтака Курита (Shigetaka Kurita) работал над платформой мобильного интернета i-mode и придумал символы эмодзи для того, чтобы упростить общение на сотовых телефонах. Первые эмодзи - это комплект из чуть больше 170 символов, каждый из которых помещался в клетку 12 на 12 пикселей. Естественно, они существенно отличались от тех, к которым мы сейчас привыкли.</p>	posts/Emoji-Meanings.png	2023-09-07 05:45:08.774473+03	2023-09-07 05:45:08.920606+03	2025-05-23 17:39:51.361461+03	f	2	2	2	<p>Just 5-10 years ago, people had little or no idea what emojis were and how to use them. And now these icons have become almost another way of communication, a separate language consisting of pictures. People on social media actively insert emoji into their posts, and companies use emoji in advertising. But even now, few people know how and when emoji appeared.</p>\r\n\r\n<p>The unusual word &ldquo;emoji&rdquo; (or in English &ldquo;emoji&rdquo;) came into our speech from the Japanese language: 絵文字, where 絵 is a picture and 文字 is a sign, symbol. It&rsquo;s easy to guess that they were invented in Japan. It happened in 1999: Shigetaka Kurita was working on the i-mode mobile Internet platform and came up with emoji symbols in order to simplify communication on cell phones. The first emoji were a set of just over 170 characters, each of which was placed in a 12 by 12 pixel cell. Naturally, they were significantly different from those to which we are now accustomed.</p>	<p>Еще лет 5-10 назад люди слабо представляли или вообще не знали, что такое эмодзи и как их использовать. А сейчас эти значки стали чуть ли не еще одним способом общения, отдельным языком, состоящим из картинок. Люди в социальных сетях активно вставляют эмодзи в свои сообщения, а компании используют эмодзи в рекламе.&nbsp;Но даже сейчас немногие знают, как и когда появились эмодзи.</p>\r\n\r\n<p>Необычное слово &laquo;эмодзи&raquo; (или на английском &ldquo;emoji&rdquo;) пришло в нашу речь из японского языка: 絵文字, где 絵 &mdash; картинка и 文字 &mdash; знак, символ. Несложно догадаться, что они были придуманы именно в Японии. Произошло это в 1999 году: Сигэтака Курита (Shigetaka Kurita) работал над платформой мобильного интернета i-mode и придумал символы эмодзи для того, чтобы упростить общение на сотовых телефонах. Первые эмодзи - это комплект из чуть больше 170 символов, каждый из которых помещался в клетку 12 на 12 пикселей. Естественно, они существенно отличались от тех, к которым мы сейчас привыкли.</p>	The history of emoji	История появления эмодзи
2	Коты - это жидкость	koty-eto-zhidkost	<p>Миллионы фотографий в интернете подтверждают, что коты &mdash; это жидкость. Но анатомический атлас упорно говорит, что внутри этих комков шерсти всё же есть кости и мышцы &mdash; как у любой животины. Так каким же образом усатым удаётся впихнуть невпихуемое и пролезть буквально сквозь игольное ушко? Говорят: если в отверстие пролезет кошачья голова, значит и обладатель её тоже поместится. Хотя дело тут не совсем в мордахе, а скорее в том, что на ней растёт. Усы-вибриссы служат котику подобием измерительного прибора, с помощью которого шерстяной лучше осознаёт масштабы пространства и оценивает свои способности. Но способности эти превеликие!</p>	posts/00134_wq2z-zC0oGs.jpg	2023-07-04 18:31:07.236103+03	2023-07-04 18:31:07.255169+03	2023-10-25 05:48:31.404112+03	f	2	1	1	<p>Millions of photographs on the Internet confirm that cats are liquid. But the anatomical atlas stubbornly says that inside these furballs there are still bones and muscles - like any animal. So how do the mustachios manage to cram in the unfitting and literally crawl through the eye of a needle? They say: if a cat&#39;s head fits into the hole, then the owner will fit in too. Although the point here is not entirely in the face, but rather in what grows on it. Whiskers serve as a kind of measuring device for the cat, with the help of which the cat better understands the scale of space and evaluates its abilities. But these abilities are great!</p>	<p>Миллионы фотографий в интернете подтверждают, что коты &mdash; это жидкость. Но анатомический атлас упорно говорит, что внутри этих комков шерсти всё же есть кости и мышцы &mdash; как у любой животины. Так каким же образом усатым удаётся впихнуть невпихуемое и пролезть буквально сквозь игольное ушко? Говорят: если в отверстие пролезет кошачья голова, значит и обладатель её тоже поместится. Хотя дело тут не совсем в мордахе, а скорее в том, что на ней растёт. Усы-вибриссы служат котику подобием измерительного прибора, с помощью которого шерстяной лучше осознаёт масштабы пространства и оценивает свои способности. Но способности эти превеликие!</p>	Cats are liquid	Коты - это жидкость
4	Django ORM	django-orm	<p>Django ORM (Object Relational Mapping) &ndash; одна из самых мощных функций Django. Благодаря ей мы можем взаимодействовать с базой данных, используя код Python вместо SQL.</p>\r\n\r\n<p>Использование ORM дает несколько преимуществ:</p>\r\n\r\n<p>1) Благодаря ORM у нас есть миграция: мы можем легко изменять наши таблицы, обновлять наши модели, и Django автоматически сгенерирует сценарии миграции, необходимый для обновления таблиц базы данных.</p>\r\n\r\n<p>2) Есть транзакции: мы можем делать несколько обновлений базы данных в рамках транзакции и, если что-то не получится, легко откатиться до того состояния, которое было при запуске.</p>\r\n\r\n<p>Но также у ORM есть некоторые недостатки:</p>\r\n\r\n<p>1) Поскольку это абстракция поверх SQL, то мы не всегда знаем точно, какие SQL-запросы будут генерироваться из нашего кода Python.</p>\r\n\r\n<p>2) Django не может угадать, когда нам нужно использовать связанную таблицу, поэтому она не будет выполнять JOINs для нас, когда они нам нужны.</p>\r\n\r\n<p>3) ORM дает нам неверное ощущение легкости, и мы не всегда понимаем то, что мы делаем, что может создавать большую нагрузку на сервер. У нас нет простого способа узнать, что доступ к атрибуту в объекте может вызвать дополнительный запрос к базе данных, который можно было бы предотвратить с помощью JOIN.</p>	posts/django_p.jpg	2023-09-06 06:09:41.881203+03	2023-09-06 06:09:42.084462+03	2025-05-23 17:38:26.347983+03	f	2	1	\N	<p>Django ORM (Object Relational Mapping) is one of the most powerful features of Django. Thanks to it, we can interact with the database using Python code instead of SQL.</p>\r\n\r\n<p>Using an ORM provides several advantages:</p>\r\n\r\n<p>1) Thanks to ORM we have migration: we can easily change our tables, update our models, and Django will automatically generate the migration scripts needed to update the database tables.</p>\r\n\r\n<p>2) There are transactions: we can make several database updates within a transaction and, if something doesn&rsquo;t work out, we can easily roll back to the state that was at startup.</p>\r\n\r\n<p>But ORM also has some disadvantages:</p>\r\n\r\n<p>1) Since this is an abstraction on top of SQL, we don&#39;t always know exactly what SQL queries will be generated from our Python code.</p>\r\n\r\n<p>2) Django can&#39;t guess when we need to use a related table, so it won&#39;t do JOINs for us when we need them.</p>\r\n\r\n<p>3) ORM gives us the wrong feeling of ease and we don&#39;t always understand what we are doing, which can create a lot of load on the server. We have no easy way to know that accessing an attribute on an object might cause an additional database query that could be prevented by using a JOIN.</p>	<p>Django ORM (Object Relational Mapping) &ndash; одна из самых мощных функций Django. Благодаря ей мы можем взаимодействовать с базой данных, используя код Python вместо SQL.</p>\r\n\r\n<p>Использование ORM дает несколько преимуществ:</p>\r\n\r\n<p>1) Благодаря ORM у нас есть миграция: мы можем легко изменять наши таблицы, обновлять наши модели, и Django автоматически сгенерирует сценарии миграции, необходимый для обновления таблиц базы данных.</p>\r\n\r\n<p>2) Есть транзакции: мы можем делать несколько обновлений базы данных в рамках транзакции и, если что-то не получится, легко откатиться до того состояния, которое было при запуске.</p>\r\n\r\n<p>Но также у ORM есть некоторые недостатки:</p>\r\n\r\n<p>1) Поскольку это абстракция поверх SQL, то мы не всегда знаем точно, какие SQL-запросы будут генерироваться из нашего кода Python.</p>\r\n\r\n<p>2) Django не может угадать, когда нам нужно использовать связанную таблицу, поэтому она не будет выполнять JOINs для нас, когда они нам нужны.</p>\r\n\r\n<p>3) ORM дает нам неверное ощущение легкости, и мы не всегда понимаем то, что мы делаем, что может создавать большую нагрузку на сервер. У нас нет простого способа узнать, что доступ к атрибуту в объекте может вызвать дополнительный запрос к базе данных, который можно было бы предотвратить с помощью JOIN.</p>	Django ORM	Django ORM
3	Вред фастфуда	vred-fastfuda	<p>В этой пище почти нет клетчатки, а значит, она застаивается в кишечнике, бродит и гниет там, приводит к вздутию живота, дискомфорту в животе, способствует запорам. Кроме того, нарушается всасывание витаминов и железа &ndash; это приводит к анемии и снижению иммунитета.</p>	posts/a6cd60e0b03183674982d83a7857ed6c26d4f6cb.jpg	2023-07-05 12:38:59.319931+03	2023-07-05 12:38:59.523384+03	2025-05-23 17:39:23.427557+03	f	5	4	\N	<p>There is almost no fiber in this food, which means it stagnates in the intestines, ferments and rots there, leading to bloating, abdominal discomfort, and promoting constipation. In addition, the absorption of vitamins and iron is impaired - this leads to anemia and decreased immunity.</p>	<p>В этой пище почти нет клетчатки, а значит, она застаивается в кишечнике, бродит и гниет там, приводит к вздутию живота, дискомфорту в животе, способствует запорам. Кроме того, нарушается всасывание витаминов и железа &ndash; это приводит к анемии и снижению иммунитета.</p>	The harm of fast food	Вред фастфуда
